	#error_page,.error_page
{
	height:auto
}
	#error_page>.inner,.error_page>.inner
{
	text-align:center;
	height:auto;
	overflow:hidden;
	padding:24px 24px 36px
}
	#error_page>.inner img,.error_page>.inner img
{
	max-width:420px;
	width:90%
}
	#error_page>.inner .message,.error_page>.inner .message
{
	font-size:0.7em
}
	#error_page.e500>.inner img,.error_page.e500>.inner img
{
	width:70%;
	max-width:420px
}
	#error_page .message,.error_page .message
{
	font-size:1em;
	padding:32px 0 24px
}
	#error_page .message h1,#error_page .message h2,.error_page .message h1,.error_page .message h2
{
	margin:0;
	color:#666;
	text-transform:uppercase
}
	#error_page .message h1,.error_page .message h1
{
	font-family:DINCond, Helvetica, Arial, sans-serif;
	font-weight:600;
	font-size:2.6em;
	padding-bottom:0.2em;
	letter-spacing:0.06em
}
	#error_page .message h2,.error_page .message h2
{
	font-family:DINCond, Helvetica, Arial, sans-serif;
	font-weight:400;
	font-size:2.1em;
	padding-right:12px;
	padding-left:12px;
	letter-spacing:0.08em;
	padding-bottom:0.4em;
	line-height:1.1em
}
	#error_page form.search-form,.error_page form.search-form
{
	max-width:720px;
	margin:0 auto;
	font-size:0.9rem
}

	@media screen and (min-width: 480px)
{
	#error_page>.inner img,.error_page>.inner img
{
	max-width:600px;
	width:90%
}

}
	@media screen and (min-width: 768px)
{
	#error_page>.inner,.error_page>.inner
{
	margin:0 auto;
	width:90%
}
	#error_page>.inner img,.error_page>.inner img
{
	width:80%;
	margin-bottom:-380px
}
	#error_page>.inner .message,.error_page>.inner .message
{
	font-size:1em;
	margin-top:380px
}
	#error_page.e500>.inner img,.error_page.e500>.inner img
{
	max-width:420px
}

}
